import Swal from "sweetalert2";
import React, { Component} from 'react';
import axios from 'axios';
import CheckoutSteps from '../checkoutSteps/checkoutSteps';


class ApprovedWorkshopProposal extends Component {
  constructor(props) {
    super(props);
    this.state = {
      approvedWorkshopProposal: [],
      workshopProposal:[],
      reviewers:[]

    }
    
  }
  componentDidMount() {
    axios.get('http://localhost:7000/approvedWorkshopProposal/')
    .then(response => {
      this.setState({ approvedWorkshopProposal: response.data.data });
    })
  }
/*
  navigateSubjectPage(e, workshopProposalId) {
    window.location = `/${workshopProposalId}`
  }*/
/*
  viewProposal(e , workshopProposalId) {
    window.location = `/${workshopProposalId}`
    console.log("View", workshopProposalId)
    //axios.get(`http://localhost:7000/workshopProposal/${workshopProposalId}`)
    
  }*/


/*
viewEmployee(id){
  this.props.history.push(`/view-employee/${id}`);
}
editEmployee(id){
  this.props.history.push(`/add-employee/${id}`);
}*/

  render() {
    
  
    return (
      
      <div>
      <CheckoutSteps step1></CheckoutSteps>
      
        <div className="container">
            <div className = "row">
                <div className="col-8"><h1>Approved Workshop Proposals</h1></div>
              
            </div>
            <div className = "row">
                
            </div>
            <br/>
            
                <div className="container">
                  <br></br>
                    <table className="table table-hover">
                        <thead>
                            <tr>
                            <th scope="col">Workshop Proposal Name</th>
                            <th scope="col">Approved Date</th>
                            <th scope="col">Approved Reviewer</th>
                            
                            <th></th>
                            <th></th>
                            </tr>
                        </thead>
                        <tbody>
                        {this.state.approvedWorkshopProposal.length > 0 && this.state.approvedWorkshopProposal.map((item, index) => (
                            
                          
                            <tr key={index} >
                            <td>{item.approvedDate}</td>
                            <td>{item.title}</td>
                            
                            
                            
                    
                            <td><button type="button"  className="btn btn-warning" onClick={e => this.editProposal(e, item._id)} >View</button>
                            </td>
                      
                            <td><button type="button" className="btn btn-danger"  onClick={e => this.deleteProposal(e, item._id)} >Delete</button></td>
                            </tr>
                        ))}    
                        </tbody>
                    </table>
                </div>
        </div>
        </div>
      
    )
}

}


export default ApprovedWorkshopProposal;
